    constructor(){
      super()
      this.state = {
        pageState: "home"
      }
    }


  handleTranslateme=()=>{
    this.setState({
      pageState: "translateme"
    })
  }

  handleRickAndMorty=()=>{
    this.setState({
      pageState: "rickandmorty"
    })
  }

  handleTonester=()=>{
    this.setState({
      pageState: "tonester"
    })
  }

  handlePage=()=>{}

  render(){
  return (
    <div className="App">
     <Navigationbar/>

     {this.state.pageState === "translateme"? <Translateme/> : <Projects handleTranslateme={this.handleTranslateme}/>}
